// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract ShareDistribution {
    using SafeMath for uint256;

    uint256 constant MAX_PARTIES = 10;
    uint256 constant MAX_THRESHOLD = 7;

    uint256 public p; // the prime number, defined as the modulus
    uint256 public secret; // the secret to be distributed
    uint256 public numberOfParties; // the number of parties n
    uint256[MAX_PARTIES] public partyShares; // the array that contains the shares of the parties. [i] contains the share of party _i
    uint256 public threshold; // the minimum number of parties to reconstruct
    uint256[MAX_THRESHOLD-1] public coefficients; // the coefficients used by the Dealer for constructing the shares

    constructor(uint256 n, uint256 t, uint256 size) {
        require(n <= MAX_PARTIES, "Number of parties exceeds maximum");
        require(t <= MAX_THRESHOLD, "Threshold exceeds maximum");
        require(t <= n, "Threshold must be less than or equal to the number of parties");
        require(size > 1, "Modulus must be greater than 1");

        numberOfParties = n;
        threshold = t;
        p = size; // assuming `size` is already a prime number

        secret = uint256(keccak256(abi.encodePacked(block.timestamp, block.basefee))); // generating a random secret

        for (uint256 i = 0; i < numberOfParties; i++) {
            partyShares[i] = 0;
        }

        for (uint256 i = 0; i < threshold - 1; i++) {
            coefficients[i] = uint256(keccak256(abi.encodePacked(block.timestamp + i))) % p;
        }
    }

    function constructShare() public {
        for (uint256 j = 1; j <= numberOfParties; j++) {
            uint256 index = j;
            for (uint256 i = threshold - 2; i >= 0; i--) {
                partyShares[j-1] = partyShares[j-1].add(coefficients[i]).mul(index) % p;
            }
            partyShares[j-1] = (partyShares[j-1] + secret) % p;
        }
    }

    function reConstruction(uint256[MAX_THRESHOLD] memory indices) public view returns (uint256) {
        uint256 shareRecons = 0;
        for (uint256 i = 0; i < threshold; i++) {
            uint256 langCoff = 1;
            uint256 I = indices[i];
            uint256 addInv_I = (p - I) % p;
            for (uint256 j = 0; j < threshold; j++) {
                uint256 J = indices[j];
                if (i != j) {
                    uint256 temp = (J + addInv_I) % p;
                    temp = modInverse(temp, p);
                    langCoff = (langCoff.mul(J.mul(temp)) % p) % p;
                }
            }
            shareRecons = (shareRecons + (partyShares[indices[i]-1].mul(langCoff)) % p) % p;
        }
        return shareRecons;
    }

    // Modular inverse function
    function modInverse(uint256 a, uint256 m) internal pure returns (uint256) {
        int256 t;
        int256 q;
        int256 r;
        int256 r1;
        int256 r2;

        if (a == 0) revert("modInverse: zero divisor");
        if (int256(a) < 0) a = uint256(int256(a) + int256(m));

        r1 = int256(m);
        r2 = int256(a);
        while (r2 > 0) {
            q = r1 / r2;
            r = r1 - q * r2;
            t = r1;
            r1 = r2;
            r2 = r;
        }

        if (r1 != 1) revert("modInverse: not invertible");
        return uint256(t);
    }
}

